<style type="text/css">
body, td {

}

body {

  margin: auto;
  padding: 1em;
  line-height: 20px;
}

tt, code, pre {

}

h1 {

}

h2 {

}

}

}

pre, img {
  max-width: 100%;
}
pre {

}

}

code {

}

code[class] {
  background-color: #F8F8F8;
}

table, td, th {
  border: none;
}

blockquote {

      color: black !important;
      filter:none !important;

      text-decoration: underline;

   hr {
      visibility: hidden;
      page-break-before: always;
   }

   pre, blockquote {
      padding-right: 1em;
      page-break-inside: avoid;
   }

   tr, img {
      page-break-inside: avoid;
   }

   img {
      max-width: 100% !important;
   }

   @page :left {
      margin: 15mm 20mm 15mm 10mm;

   @page :right {
      margin: 15mm 10mm 15mm 20mm;
   }

   p, h2, h3 {
      orphans: 3; widows: 3;
   }

   h2, h3 {
      page-break-after: avoid;
   }
}
